const Product = () =>{
    return(
        <section class="blog-banner-area" id="category">
            <div class="container h-100">
                <div class="blog-banner">
                    <div>
                        <h1 class="h">KEYCHAINS</h1>
                    </div>
                </div>
            </div>
        </section>
    );
}
export default Product;
